import React from 'react';

const Results = (props) => {
  return (
    <section className="results">
      <ul>
        {Object.keys(props.results).map((item, idx) => {
          return (
            <li key={idx}>{props.results[item]}</li>
          )
        })}
      </ul>
    </section>
  )

}

export default Results;
